import React from "react";
import { Line, Circle } from "rc-progress";


const Skills = () => {
  return (
  <>
    <Line percent="10" strokeWidth="4" strokeColor="#D3D3D3" />
    <Circle percent="90" strokeWidth="4" strokeColor="#D3D3D3" />
  </>
  );
};

export default Skills;
